MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "");
MGCAddSnippet(5, "The CalibreAuto-Waivers tool enables you to generate waivers for rules that are considered safe to ignore. You can then apply the waivers, which are geometrical shapes that resemble the original error result region, automatically in a verification run wherever an error result for the same waived rule appears.");
MGCAddSnippet(6, "When verifying a design, the foundry can waive certain rule check violations. These waivers need to be managed in the results output so that they can be preserved for analysis and validation. Inspecting such waivers manually consumes much time.");
MGCAddSnippet(7, "You can use both the Calibre Auto-Waivers and Calibre RVE tools to waive rule check errors. Historically, Calibre RVE has used an ASCII file (.waived extension) to mark rule checks as waived. Calibre RVE also supports Calibre Auto-Waivers. The Calibre Auto-Waivers flow offers significant advantages in flexibility. ");
MGCAddSnippet(8, "There are several terms specific to Calibre Auto-Waivers that are used throughout this manual. It is highly recommended that you fully understand the terminology and concepts before using the tool.");
MGCAddSnippet(9, "To improve flexibility and management, you can generate waivers within your design database or in separate layout databases. Waivers that are saved along with your layout design are called embedded waiver shapes, and waivers that are saved in external databases are called non‑embedded waiver shapes.");
MGCAddSnippet(10, "Calibre Auto-Waivers can use embedded or external waiver shapes in your DRC flow. Specified DRC results can be waived interactively with Calibre RVE, or in batch mode with waiver_flow, where Calibre RVE is the recommended method.");
MGCAddSnippet(11, "The ERC automatic waivers can use embedded or external waiver shapes, just like DRC or DFM automatic waivers. ");
MGCAddSnippet(12, "The DFM automatic waivers flow is similar to DRC and ERC automatic waivers, except that it produces a binary DFM Database rather than ASCII results databases.");
MGCAddSnippet(13, "The Calibre Auto-Waivers license also enables waivers for CalibrePERC. ");
MGCAddSnippet(14, "Calibre Auto-Waivers requires its own license and existing Calibre licenses for each verification tool. Depending on the use case, you may also choose to configure the tool by writing a waiver setup file.");
MGCAddSnippet(15, "Calibre tools require that the CALIBRE_HOME environment variable be set.");
MGCAddSnippet(16, "Most of the commonly used layer operations for DRC rule checks are processed by default by the waiver_flow executable and calibre -waiver. ");
MGCAddSnippet(17, "Certain DFM operations are supported by Calibre Auto-Waivers.");
MGCAddSnippet(18, "If the waiver_flow -erc option is used, then the operation is enabled for use by default, along with the Net Area family of layer operations. ERC waivers are highly context-dependent because of connectivity considerations. Note that the ERC Pathchk specification statement is not supported for waivers.");
MGCAddSnippet(19, "Some layer operations are generally discouraged for automated waivers because the waiver output is highly dependent upon the state of the design. Discouraged operations may be used, but you should be aware of their main limitation: sensitivity to the completeness of the design and the entire connectivity layer set. ");
MGCAddSnippet(20, "Some layer operations are not supported in waiver_flow only. Results from such operations may have waiver shapes produced for them by other tools such as Calibre RVE. ");
MGCAddSnippet(21, "Some layer operations are not supported for automated waivers at all.");
MGCAddSnippet(22, "You must follow certain guidelines to ensure correct waiver application for encrypted checks.");
MGCAddSnippet(23, "The command descriptions use font properties and several metacharacters to document the command syntax.");
MGCAddSnippet(24, "If you encounter issues using this release of Calibre Auto-Waivers, refer to this topic for possible causes and workarounds.");
MGCAddSnippet(25, "You can perform waiver generation in batch mode or interactively using Calibre Interactive or Calibre RVE. Calibre RVE is the preferred method for generating waivers. Waiver application can also be done in batch mode and Calibre Interactive.");
MGCAddSnippet(26, "You can export waiver shapes into an existing design database (embedded waivers), or as separate layout files (non-embedded), or both. The waiver shape export method has implications for how waivers are used in third-party design tools. ");
MGCAddSnippet(27, "You can generate waivers for DRC, ERC, or DFM Critical Feature Analysis using Calibre RVE, Calibre Interactive, or the waiver_flow utility.");
MGCAddSnippet(28, "You can waive approved error results by applying the waivers in a verification run. This procedure assumes you have generated waiver shapes for your design. ");
MGCAddSnippet(29, "Top-level Density results are merged into single shapes that can be comprised of multiple windows. Typically, you should waive results on a per-window basis rather than on a merged-window (top-level) basis to ensure the intended result. ");
MGCAddSnippet(30, "You can use Calibre RVE to waive merged (DRC results database top-level) results interactively.");
MGCAddSnippet(31, "You can generate batch Density waivers for per-window results with the waiver_flow utility.");
MGCAddSnippet(32, "You apply Density waivers in a physical verification run similar to DRC or ERC waivers. You will run density waiver verification whether you used Method 1 or 2 to generate your Density waivers. ");
MGCAddSnippet(33, "You can waive rule check results within the extent of a cell, which can be used for any rule check for which you want to waive DRC or ERC results that touch the extent of a cell. Cell extent waivers are often useful in cases where an unplaced cell is known to be  clean, but the cell has Density errors when placed in the design. This happens because the Density window grid uses a different basepoint in the full design.");
MGCAddSnippet(34, "This topic provides solutions to common issues related to the Calibre Auto-Waivers flow.");
MGCAddSnippet(35, "The waiver criteria file controls how waiver shapes are applied in a physical verification run. It is important to understand the different types of interactions that waiver shapes can have with an error result region and how the criteria can be used to determine whether a result is waived. Waiver shapes for edge and edge cluster outputs behave differently than result regions, so some consideration is necessary when generating and applying results for these types of outputs. ");
MGCAddSnippet(36, "Waiver shapes are generated either using Calibre RVE interactively or running the waiver_flow executable in batch mode. ");
MGCAddSnippet(37, "A SINGLE interaction enforces the condition that only one waiver shape can interact with a result region in order for the waiver to apply. Single interactions are the most conservative method of applying a waiver. ");
MGCAddSnippet(38, "A MULTI interaction enables more than one waiver shape to overlap a result region. ");
MGCAddSnippet(39, "The waiver and overlap criteria control the relative conservativeness of the various waiver settings. The more conservative a setting is, the fewer waivers are enforced. Also, the more conservative a setting is, the closer the waiver shape (or shapes) must exactly overlay the shape of the error result region in order for the waiver to apply. ");
MGCAddSnippet(40, "Rule checks can output single edges or edge clusters. Waivers are based upon area coverage, but edges have no area; hence, Calibre Auto‑Waivers converts edges and edge clusters to polygons in order to apply waivers. ");
MGCAddSnippet(41, "You can use the waiver criteria file to remove incomplete blocks from your verification run or only include certain blocks. Unfinished blocks can impact performance and introduce large numbers of DRC results. Using the Calibre Auto‑Waivers tool to selectively ignore unfinished blocks enables you to focus on real design errors that need to be fixed, without editing the foundry rule file.");
MGCAddSnippet(42, "You can generate waivers using Calibre RVE or the waiver_flow tool. Calibre RVE is the preferred method for generating waiver shapes because you can view the results as you waive them. Waiver shapes are the primary mechanism for applying waivers in a verification run. ");
MGCAddSnippet(43, "You must meet several requirements before running Calibre RVE for DRC.");
MGCAddSnippet(44, "There are two primary methods of generating waivers: interactively with Calibre RVE and batch mode using the waiver_flow executable. ");
MGCAddSnippet(45, "If you are providing waiver-corrected design cells, such as an IP library, you can embed the waiver shapes in the design. The waivers are then automatically enforced in any design that uses the waiver-corrected cells. ");
MGCAddSnippet(46, "Export waived results to a separate GDSII or OASIS layout database using Calibre RVE. When using this method, waiver shapes are not embedded in the main design s data. The waiver cells and shapes are kept separate, and are merged with the primary design at runtime by Calibre. The Calibre RVE method is generally preferable to using the waiver_flow tool because it is interactive.");
MGCAddSnippet(47, "Calibre RVE can export waiver shapes to a design database that is open in Cadence Virtuoso.");
MGCAddSnippet(48, "You can create IP_MATCH cell signatures using Calibre RVE. IP_MATCH cell signatures allow the waivers in a cell to be applied to cells that have a different name but are otherwise the same.");
MGCAddSnippet(49, "Load a waiver setup file when exporting waivers using Calibre RVE. This is useful if you want to use the layer and datatype settings in the waiver setup file for the waiver shapes and text annotations, rather than the default settings. ");
MGCAddSnippet(50, "When Calibre RVE exports edge results it displays a popup message titled  Warning: Exporting Edges  because the resulting waiver shape may not match the result shapes generated by Calibre.");
MGCAddSnippet(51, "Sets additional waiver options for Calibre RVE.");
MGCAddSnippet(52, "The waiver_flow executable generates waiver shapes in batch mode. The tool is multi-threaded, and for larger designs, that is the preferable run mode.");
MGCAddSnippet(53, "In order to generate waivers with the waiver_flow tool, you must have a waiver cells file to define the cells from which waivers are generated. This file must be written manually and must be prepared before a waiver_flow run.");
MGCAddSnippet(54, "The waiver criteria file is optional. If you do not create this file, SINGLE 100 100 is written to all waiver cells. Use this file to specify non-default criteria, such as SINGLE 98 98. The criteria text is used when applying waivers in a verification run. The criteria does not affect the waiver generation process. ");
MGCAddSnippet(55, "In order to generate waiver geometry with waiver_flow, you must have a waiver generation setup file to define the inputs and outputs. ");
MGCAddSnippet(56, "The waiver_flow executable generates waiver shapes in batch mode. ");
MGCAddSnippet(57, "Use the waiver_flow tool to generate waiver shapes in batch mode.");
MGCAddSnippet(58, "You can generate waiver shapes with rule checksum annotations using waiver_flow. In a verification run with waivers, any rule checksum in the waiver cell is compared to the rule in the specified rule file. If the checksum does not match the corresponding rule or rule filename, a warning is issued and waivers are not applied for that rule. ");
MGCAddSnippet(59, "If the rule and layout precisions are different, then the tool s internal view of a result may be different from the waiver shape, depending on how the waivers are saved and stored.");
MGCAddSnippet(60, "The waiver setup, waiver criteria, and waiver cells files control how waivers are generated and applied in batch mode. These files are also used to control Calibre Interactive and options in the Calibre RVE Export Waived Results window. The output files produced by Calibre Auto-Waivers depend on whether you are generating waivers or applying waivers and on the type of verification run.");
MGCAddSnippet(61, "The waiver setup file acts as a control file for the various commands, inputs, and outputs used in the waiver generation and verification flows. It can be specified in a batch run or in Calibre Interactive and Calibre RVE.");
MGCAddSnippet(62, "The waiver setup file controls waiver generation for the waiver_flow utility and specifies options in a verification run with calibre -waiver. ");
MGCAddSnippet(63, "Specifies input and output parameters for waiver_flow. ");
MGCAddSnippet(64, "Specifies runtime parameters for a calibre -waiver run. ");
MGCAddSnippet(65, "Waiver description files are used to define the waivers that you intend to enforce. There are two waiver description files: the waiver criteria and the waiver cells files. ");
MGCAddSnippet(66, "The waiver criteria file is optionally used by the waiver_flow executable to generate waiver shapes with custom criteria. It is used during calibre -waiver runs to enforce waivers. It can be imported into Calibre RVE to define waiver criteria.");
MGCAddSnippet(67, "This file is optional for waiver generation in waiver_flow and verification in calibre -waiver. It is used in calibre -waiver to specify criteria for waiver shapes. ");
MGCAddSnippet(68, "The standard form criteria specifies the waiver interaction type and the overlap values used to determine whether the waiver should be applied to the result.");
MGCAddSnippet(69, "Optional parameter set that excludes all geometries from specified cells from the waiver run. This option is useful if you want to remove certain cells (blocks) from your run that can impact performance and introduce errors that can be ignored. ");
MGCAddSnippet(70, "Optional parameter set that includes all geometries from the specified cells in the waiver run. All other cells are ignored.");
MGCAddSnippet(71, "Specifies that waivers are applied based upon the extent of the cell and the rule name. Results that intersect the cell s extent and meet the result overlap criterion are waived. ");
MGCAddSnippet(72, "Specifies that waivers are applied based upon the marker layer and the rule name. The marker layer is defined in the rule file. Results that intersect the marker layer and meet the result overlap criterion are waived.");
MGCAddSnippet(73, "Specifies that waivers are applied based upon the pattern definition parameters and waiver criteria. Only Topological Edge Matching (TEM) patterns are supported.");
MGCAddSnippet(74, "Specifies that the waivers are applied for Density results on a per-window basis, such as the results in a Density RDB. ");
MGCAddSnippet(75, "Specifies that Calibre PERC LDL P2P resistance waivers are applied based upon a tolerance range around the waived resistance value.");
MGCAddSnippet(76, "Specifies the rules that you want to waive by cell when generating waiver shapes with the waiver_flow tool. ");
MGCAddSnippet(77, "The waiver cells file is used by the waiver_flow tool to generate waiver shapes for specified cells. It is used in Calibre RVE to specify IP_MATCH waivers during waiver export. It is ignored in calibre -waiver runs.");
MGCAddSnippet(78, "The waiver criteria and the waiver cells file are used differently depending on whether you are generating or applying waivers.");
MGCAddSnippet(79, "In order to correctly match and waive allowed error results, you must set up and run a physical verification with waivers. ");
MGCAddSnippet(80, "The verification flow for DRC, DFM, and ERC waivers is similar. The calibre ‑waiver option causes waivers to be applied for which there are waiver shapes (either in the input design or merged with it at runtime) that correspond to the waiver criteria file and waiver verification setup file specifications. ");
MGCAddSnippet(81, "Waiver setup files are generally written manually in a text editor, but you can also create and edit them with Calibre Interactive. ");
MGCAddSnippet(82, "You can specify custom criteria for waivers shapes that are applied during verification if the default values do not meet your requirements. The tool writes all waiver criteria applied to rule checks as a DRC Check Comment. These comments are visible in Calibre RVE.");
MGCAddSnippet(83, "Waiver shapes are applied to error results in a Calibre verification run.");
MGCAddSnippet(84, "Use multiple waiver-corrected IP libraries, where the IP vendors each provide you with waiver setup and waiver criteria files. Most likely, the IP libraries come from a foundry or a non-foundry vendor.");
MGCAddSnippet(85, "Apply calibre -waiver to verify rule checksums from waiver cells in a physical verification run. Rule checksums ensure that the rule code used to generate waiver cells matches the rule code used in the verification run. ");
MGCAddSnippet(86, "If you perform a verification run with waivers and you choose to generate an SVRF file from the TVF input with the ‑E option, then the tool adds statements to the generated SVRF file.");
MGCAddSnippet(87, "Calibre Auto-Waivers includes several utilities to help manage your waiver flow.");
MGCAddSnippet(88, "Translates an ASCII DRC results database or a Calibre RVE .waived file to a GDS or OASIS waiver database suitable for use in Calibre Auto-Waivers.");
MGCAddSnippet(89, "This command takes a GDSII or OASIS input file and calculates checksum values that conform to the command s parameters.");
MGCAddSnippet(90, "This command takes a GDSII or OASIS input file and performs a specified waiver operation on the file. ");
MGCAddSnippet(91, "The format and objects within the waiver cells are controlled by the waiver setup file. ");
MGCAddSnippet(92, "Waiver cell format, naming conventions, cell hierarchy, and annotations written to the waiver shapes are described.");
MGCAddSnippet(93, "Waiver shape cell hierarchy can be controlled to improve maintenance and readability of the waiver cells.");
MGCAddSnippet(94, "Text objects can be annotated to the waiver shapes to control how waivers are applied during a verification run.");
MGCAddSnippet(95, "Geometry checksums can be annotated to the waiver shapes to ensure that cells are not geometrically modified.");
MGCAddSnippet(96, "Rule checksums are used to ensure that the rule being waived has not been modified. Waivers generated in Calibre Auto-Waivers are based on the rule name. Rule checksums guarantee that the rule code associated with the rule name has not been changed since the waiver shape was last generated.");
MGCAddSnippet(97, "Version checksums can be annotated to the waiver shapes to ensure that the same version of Calibre is used during generation and verification.");
MGCAddSnippet(98, "IP_MATCH checksums can be annotated to the waiver shapes when you want to produce waivers for IP blocks.");
MGCAddSnippet(99, "Text can be annotated to empty waiver cells generated for WAIVE_EXTENT, WAIVE_MARKER, or WAIVE_PATTERN waivers.");
MGCAddSnippet(100, "Cells with waive-able errors that contain instances of cells with waive-able errors must be treated carefully in order to have waivers applied properly throughout the design.");
MGCAddSnippet(101, "Calibre Auto-Waivers optionally supports the generation of waiver shapes inside cloned cells. ");
MGCAddSnippet(102, "Waiver setup file commands are applied differently for waiver_flow and calibre -waiver.");
MGCAddSnippet(103, "It is possible to have a single setup file for both waiver_flow and calibre -waiver, but usually most users prefer to use separate files.");
MGCAddSnippet(104, "Error and warning messages are presented at Calibre Auto-Waivers run time. These messages appear in the terminal window or in the log files. Use this chapter to debug errors, warnings, and status updates received during a run with Calibre Auto-Waivers or its utilities. ");
MGCAddSnippet(105, "Runtime messages issued by Calibre Auto-Waivers applications are prefixed by an error, warning, or note string to indicate the severity of the message.");
MGCAddSnippet(106, "The following table describes the runtime messages from the drc_waiv_asc2gds tool.");
MGCAddSnippet(107, "The following table documents the runtime messages from the checksum_util tool.");
MGCAddSnippet(108, "The following tables document the error, warning, and note messages from the waiver_util tool.");
MGCAddSnippet(109, "Details on open source and third-party software that may be included with this product are available in the <your_software_installation_location>/legal directory.");

